import React, { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { useParams } from 'react-router-dom';
import { getEmployerProfileData } from '../../../actions/EmployerActions';

const EmployerPublicView = () => {

    const dispatch = useDispatch();
    const {id} = useParams();
    
  const employerData = useSelector((state) => state.employerData);
  const {userInfo} = employerData;

  console.log(userInfo);
    useEffect(() => {
        dispatch(getEmployerProfileData(id))
    },[])
  return (
    <div className='emplyeeProfile'>
       <div className="box1">
            <div className="top">
              <div className="left">
                <div className="img-box">
                  {userInfo?.image ? (
                    <img src={userInfo?.image} alt="" />
                  ) : (
                    <img
                      src="https://t3.ftcdn.net/jpg/03/46/83/96/360_F_346839683_6nAPzbhpSkIpb8pmAwufkC7c5eD7wYws.jpg"
                      alt=""
                    />
                  )}
                </div>

                <div>
                  {" "}
                  <p className="common-heading">{userInfo?.owner?.name}</p>
                  <p
                    style={{
                      marginLeft: "30px",
                      marginTop: "-10px",
                      fontSize: "14px",
                      display: "flex",
                    }}
                  >
                    <strong>since :</strong>{" "}
                    <p style={{ color: "#3CCF4E", marginLeft: "10px" }}>
                      {userInfo?.owner?.createdAt.slice(0, 10)}
                    </p>
                  </p>
                </div>
              </div>

              <div className="rigth">
                {" "}
                <button>message</button>{" "}
              </div>
            </div>

            <div className="bottom">
              <div className="left">
                <div className="left-top">
                  <span>
                    <strong>{userInfo?.totalSpend}</strong>
                    <p>Total Spent</p>
                  </span>

                  <span>
                    <strong>{userInfo?.hires}</strong>
                    <p></p>
                  </span>
                </div>

                <div className="left-bottom">
                  <span>
                    <h5>Language </h5>
                    {userInfo?.languages?.map((language) => {
                      return (
                        <p key={language?.language} style={{ marginLeft: "0px" }}>
                          {language?.language}
                        </p>
                      );
                    })}
                  </span>

                  <span>
                    <h5>Skills </h5>

                    {userInfo?.skills?.map((education) => {
                      return (
                        <li key={education?.skill} style={{ marginLeft: "0px" }}>
                          {education?.skill}
                        </li>
                      );
                    })}
                  </span>

                  <span>
                    <h5>Education </h5>
                    {userInfo?.educations?.map((education) => {
                      return (
                        <ul key={education?._id}>
                          <li>
                            <strong>{education?.school}</strong>{" "}
                          </li>
                          <li>{education?.title}</li>
                        </ul>
                      );
                    })}
                  </span>
                </div>
              </div>

              <div className="right">
                <h1 >
                  {userInfo?.userTitle}
                </h1>
                <p >{userInfo?.userInfo}</p>
              </div>
            </div>
          </div>
    </div>
  )
}

export default EmployerPublicView
